import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import { Jumbotron, Container, Row, Col, Image, Button, Carousel } from 'react-bootstrap';
import './News.css';


export default class News extends Component {
    render() {
        return (
            <div className="NewsMain">
            <h1 className="Caption">NEWS</h1>
            <p className="New"><a href="https://www.soompi.com/article/1397570wpp/exos-suho-to-reportedly-appear-on-season-3-of-busted-to-show-support-for-sehun">EXO’s Suho To Reportedly Appear On Season 3 Of “Busted!” To Show Support For Sehun</a></p>
            <p className="New"><a href="https://www.soompi.com/article/1397341wpp/sm-entertainment-confirms-exos-chen-and-his-wife-have-welcomed-1st-child">SM Entertainment Confirms EXO’s Chen And His Wife Have Welcomed 1st Child</a></p> 
            <p className="New"><a href="https://www.soompi.com/article/1397275wpp/bol4-announces-comeback-date-pre-release-track-to-feature-exos-baekhyun">BOL4 Announces Comeback Date + Pre-Release Track To Feature EXO’s Baekhyun</a></p> 
            </div>
        )
    }
}
